INSERT INTO `posts` VALUES (1,'\"Омни Актив ТЗК\" ХХК-ийн хөрөнгөөр баталгаажсан','2022-02-19 13:19:22.996000','2022-03-06 20:23:39.535000','2022-02-19 13:19:30.950000',1,1,'<p class=\"ql-align-justify\">Омни Актив ТЗК-ийн хөрөнгөөр баталгаажсан үнэт цаас нь<strong style=\"color: rgb(69, 77, 98);\">&nbsp;жилийн 14.5 хувийн хүүтэй, улирал тутам хүүгийн төлөлттэй, үндсэн төлбөр 12 сар тутам төлөгдөх нөхцөлтэй, 24 сарын хугацаатай, хугацааны дундуур зарах боломжтой, үнэт цааснаас 2 дахин өндөр барьцаагаар баталгаажсан бүтээгдэхүүн юм.&nbsp;</strong>Зах зээлд гарахын өмнө олон талын оролцогч нарын шинжилгээ дүгнэлтэд үндэслэж, тусгай зөвшөөрлийн дагуу хөрөнгө оруулагч нарт хүрч буй билээ. Энэ нь эрсдэл/өгөөжийн харьцааг харгалзан үзэхэд маш таатай нөхцөл юм. Мөн&nbsp;<strong style=\"color: rgb(69, 77, 98);\">хүүгийн татвар 5 хувь байгаа нь ижил төстэй бүтээгдэхүүнүүд болох банкны хадгаламж, хаалттай бондтой харьцуулахад 2 дахин бага хувь юм.</strong></p><p><br></p><p class=\"ql-align-justify\">Энэхүү бүтээгдэхүүн нь&nbsp;<strong style=\"color: rgb(69, 77, 98);\">2022 оны Хоёрдугаар сарын 21-ний өдрөөс 24-ний хооронд&nbsp;</strong>Монголын хөрөнгөөр биржээр дамжин арилжаалагдах бөгөөд хөрөнгө оруулагч нарт аливаа шаардлага тавихгүй, хүн бүрд нээлттэй санал болгож байна.&nbsp;<strong style=\"color: rgb(69, 77, 98);\">Хөрөнгө оруулалтын нэгжийн үнэ 100,000 төгрөг бөгөөд нээлттэй зах зээлээс нийт 5 тэрбум төгрөгийг татан төвлөрүүлэхээр зарлагдсан байна.</strong></p>',27,1,NULL),(2,'Trump-Putin: Your toolkit to help understand the story','2022-02-19 13:22:13.699000','2022-03-14 19:24:58.749000','2022-02-19 13:22:14.988000',1,1,'<p>Lorem ipsum dolor sit amet,sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, At vero eos et accusam et justo duo dolores et ea rebum. Lorem ipsum dolor sit amet, no sea takimata sanctus est Lorem ipsum dolor sit amet. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. no sea takimata sanctus est Lorem ipsum dolor sit amet. no sea takimata sanctus est Lorem ipsum dolor sit amet. sed diam voluptua.</p><p>Lorem ipsum dolor sit amet,sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, At vero eos et accusam et justo duo dolores et ea rebum. Lorem ipsum dolor sit amet, no sea takimata sanctus est Lorem ipsum dolor sit amet. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. no sea takimata sanctus est Lorem ipsum dolor sit amet. no sea takimata sanctus est Lorem ipsum dolor sit amet. sed diam voluptua. Lorem ipsum dolor sit amet,sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, At vero eos et accusam et justo duo dolores et ea rebum. Lorem ipsum dolor sit amet, no sea takimata sanctus est Lorem ipsum dolor sit amet. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. no sea takimata sanctus est</p><p><br></p><p><br></p><p><img src=\"/uploads/marker_4caed9571a.png\" alt=\"marker.png\" width=\"472\"></p>',118,1,2),(3,'Томуугийн улмаас эмнэлгүүдийн ор ашиглалт 90-93 хувьтай байна','2022-02-19 13:35:46.595000','2022-03-03 18:27:59.092000','2022-02-19 13:35:48.481000',1,1,'<p>Томуу, томуу төст өвчний тархалтын талаар&nbsp;Нийслэлийн Эрүүл мэндийн газрын дарга Б.Бямбадорж мэдээлэл өглөө.</p><p><br></p><p><strong>\"</strong>Засгийн газраас Гамшгаас х<strong>амгаалах өндөржүүлсэн бэлэн байдлын зэргийг улбар шар түвшнээс шар түвшин рүү шилжүүлэх шийдвэрийг 2022 оны хоёрдугаар сарын 14-ний өдөр гаргасан. Өдөр тутмын хэвийн амьдралд шилжсэн хэдий ч халдвар хамгааллын дэглэмээ барих, амны хаалтыг тогтмол зүүхийг анхааруулж байна.</strong></p><p><br></p><p>Хоёрдугаар сарын 18-ны байдлаар өмнөх долоо хоногтой харьцуулахад коронавируст халдварын тоо нийслэлийн хэмжээнд 37.1 хувиар буурсан. Шинжилгээний эерэг тохиолдлын тоо өмнөх долоо хоногоос 8.5 хувиар буурсан. Халдварын шалтгаантай нас баралт 50 хувиар буураад байна\" гэв.</p><p><br></p><p>Мөн томуу, томуу төст өвчний дэгдэлт их байгаа гэдгийг Нийслэлийн Эрүүл мэндийн газрын дарга тодотгов. Эмнэлгүүдийн эрчимт эмчилгээний тасагт хатгалгаа өвчний улмаас эмчлүүлэгсдийн дунд хүүхэд олон байгаа аж.</p><p><br></p><p>Томуугийн улмаас эмнэлгүүдийн ор ашиглалт 90-93 хувьтай байна. Түргэн тусламжийн дуудлагын тоо 6.2 хувиар буурсан ч хүүхэд өвдсөн гэх дуудлага 1.9 хувиар нэмэгдсэн&nbsp;байна. Тиймээс хүүхдийн нэмэлт амбулаторийг ажиллуулсаар байгаа юм.</p><p><br></p><p>Коронавирусийн халдварыг бууруулахад хамгийн үр дүнтэй арга нь дархлаажуулалт учраас цаашид ч байгууллага, салбарын түвшинд анхаарч ажиллахыг сануулав.</p>',2,1,NULL),(4,'Зах, бөөний худалдааны төвүүдийг Хөшигийн хөндий руу нүүлгэнэ','2022-02-21 16:01:31.565000','2022-03-13 12:42:37.148000','2022-02-21 16:02:45.067000',1,1,'<p>Улаанбаатар хотын төвлөрлийг сааруулахын тулд зах, бөөний худалдааны төвүүдийг үе шаттайгаар нүүлгэн шилжүүлэхээр төлөвлөжээ.</p><p><br></p><p><br></p><p>Ингэхдээ Хөшигийн хөндий, Эмээлт, Налайх зэрэг бүсэд худалдаа эрхлэгчдийг үйл ажиллагааны чиглэлээр нь суурьшуулахаар төлөвлөсөн байна.</p><p>Улаанбаатарт томоохон 111 зах, худалдааны төв байдаг бөгөөд эдгээрт 25,288 худалдаа эрхлэгч үйл ажиллагаагаа явуулдаг аж.</p><p><br></p><p>Нийслэлийн сургалт, судалгаа, олон нийттэй харилцах газраас өгсөн мэдээллээр зах, худалдааны төв ажиллахгүй өдөр ойролцоох уулзваруудаар зорчих тээврийн хэрэгслийн тоо 10-15%-аар буурсан үзүүлэлт гарчээ.</p><p>&nbsp;</p>',6,1,NULL),(5,'Нарны зам дагуух сургуулиуд болох Сант','2022-02-21 16:02:18.466000','2022-02-23 18:38:54.998000','2022-02-21 16:02:22.554000',1,1,'<p>Нарны зам дагуух сургуулиуд болох Сант</p><p><br></p><h1><strong>Нарны зам дагуух сургуулиуд болох Сант</strong></h1>',1,1,NULL),(6,'Ой тогтоолтын ДАШТ-д Монголын баг түрүүлж, Н.Мөнхшүр хошой аварга боллоо','2022-02-21 19:16:30.480000','2022-03-13 12:35:02.800000','2022-02-21 19:16:39.135000',1,1,'<p><span style=\"background-color: rgb(226, 241, 249);\">Монгол Улсаа төлөөлж нийт 19 тамирчин тус тэмцээнд оролцсоноос таван тамирчин ОУ-ын Мастерын цолтны болзол хангалаа.</span></p><p><br></p><p><br></p><p>Ийнхүү манай ой тогтоолт, цээж бодолт, хурдан уншлага, спорт өрөлтийн шигшээ баг маань Англи, Америк, Герман, Хятад, Солонгос, Энэтхэг гээд дэлхийн олон оронд зохион байгуулагдсан олон улсын 60 дахь тэмцээндээ амжилттай оролцож амжилтын буухиагаа таслалгүй үргэлжлүүлсээр байна\" хэмээн өөрийн цахим хуудсандаа бичжээ.</p><p><br></p><p>Мөн тэрбээр, бүх тамирчиндаа болон&nbsp;багш дасгалжуулагч нартаа, тамирчдынхаа гэр бүл, дэмжигчдэдээ баяр хүргэж&nbsp;ойлгож тусалж дэмждэг хүмүүстээ бүгдэд нь талархал илэрхийлсэн байна.</p>',20,1,NULL),(7,'Ихэнх нутгаар хүйтний эрч суларна','2022-02-21 20:33:20.616000','2022-03-13 18:29:52.901000','2022-02-21 20:33:26.309000',1,1,'<h2>444444</h2><h2>55Ихэнх нутгаар хүйтний эрч суларна</h2><p>&nbsp;</p><h2>Ихэнх нутгаар хүйтний эрч суларна</h2><p>aaa</p><h2>Ихэнх нутгаар хүйтний эрч суларна</h2>',11,1,3),(8,'Хөдөө, орон нутгийн эмч нарын цахим ур чадварыг сайжруулна','2022-02-21 20:34:47.099000','2022-03-13 16:38:31.519000','2022-02-21 20:35:05.969000',1,1,'<h1>Хөдөө, орон нутгийн эмч нарын цахим ур чадварыг сайжруулна</h1><p><br></p><h1>Хөдөө, орон нутгийн эмч нарын цахим ур чадварыг сайжруулна</h1>',14,1,NULL),(9,'Хөгжлийн Банкны драма','2022-02-22 17:27:56.994000','2022-02-23 16:11:42.653000','2022-02-22 17:27:58.120000',1,1,'<p>АИ-92 бензиний&nbsp;үнэ долдугаар сард 600 төгрөгөөр өсч, 2,050 болов.</p><p>Тээврийн зардал нэмэгдэхээр өргөн хэрэглээний бараг бүх бараа, үйлчилгээний үнэ өсч байна. Таван жилийн өмнө 1,530 төгрөг байсан бензин энэ дарааллаар жил бүр өссөөр ирсэн. Манайд онцлог нь үнэ хэзээ ч буцаж буурдаггүй. Хүмүүс эхлээд баахан бухимддаг, заримдаа жагсдаг, үнэ бууруулахыг эсвэл цалин нэмэхийг төрөөс шаарддаг, тэгээд л дасчихдаг. Ихэнх хүмүүс социализмын үе шиг үнийг төр тогтоод</p>',1,1,NULL),(10,'Шинэ хоршоо хөдөлгөөн','2022-02-22 17:33:12.326000','2022-02-23 16:11:39.703000','2022-02-22 17:33:15.182000',1,1,'<h1>Шинэ хоршоо хөдөлгөөн</h1><h1>Шинэ хоршоо хөдөлгөөн</h1>',1,1,NULL),(11,'Хаан банкны ажилтнууд','2022-02-22 17:34:15.599000','2022-02-22 17:34:17.756000','2022-02-22 17:34:17.751000',1,1,'<h1>Хаан банкны ажилтнууд</h1><h1>Хаан банкны ажилтнууд</h1>',NULL,1,NULL),(12,'ФИНТЕК: Эдийн бус хөрөнгө ба түүхэн боломж','2022-02-22 17:34:58.393000','2022-03-13 18:50:33.659000','2022-02-22 17:35:00.932000',1,1,'<h1>ФИНТЕК: Эдийн бус хөрөнгө ба түүхэн боломж</h1><h1>ФИНТЕК: Эдийн бус хөрөнгө ба түүхэн боломж</h1>',18,1,NULL),(13,'Монгол хүний амь нас ямар үнэтэй вэ?','2022-02-22 17:35:31.418000','2022-03-13 18:06:51.959000','2022-02-22 17:35:33.416000',1,1,'<h1>Монгол хүний амь нас ямар үнэтэй вэ?</h1><h1>Монгол хүний амь нас ямар үнэтэй вэ?</h1>',7,1,NULL),(14,'Брент төрлийн газрын тосны үнэ хоёр хувиар өсөж','2022-02-22 17:43:17.574000','2022-03-01 18:09:26.728000','2022-02-22 17:43:19.113000',1,1,'<h1>Брент төрлийн газрын тосны үнэ хоёр хувиар өсөж,</h1><h1>Брент төрлийн газрын тосны үнэ хоёр хувиар өсөж,</h1>',8,1,NULL),(15,'Дэвшилтэт технологийг ашигласан, оюутнууд','2022-02-22 17:44:58.864000','2022-02-22 17:45:01.600000','2022-02-22 17:45:01.595000',1,1,'<h1>Дэвшилтэт технологийг ашигласан, оюутнууд</h1><h1>Дэвшилтэт технологийг ашигласан, оюутнууд</h1>',NULL,1,NULL),(16,'Брент төрлийн газрын тосны үнэ хоёр хувиар өсөж,','2022-02-22 17:51:31.871000','2022-03-13 16:33:43.559000','2022-02-22 17:51:34.238000',1,1,'<h1>Брент төрлийн газрын тосны үнэ хоёр хувиар өсөж,</h1>',6,1,NULL);
